import { Component } from '@angular/core';
import {ProductModel} from './carousel-builder/product.model.';
import {mock_list} from './carousel-builder/mock_list.';
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Sheetz';
  products:ProductModel []=[];
  constructor(){
    for(var item of mock_list){
      console.log(item);
      this.products.push(item);
    }
  }
}


@Component({
  selector:'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
<!-- Nav Bar and Other Top of Page Features -->
<app-side-nav></app-side-nav>
<!-- Middle Icon Card -->
<app-middle-icon-card></app-middle-icon-card>
<!-- Carousel Builder -->
<div class="container-fluid d-flex">
<div *ngFor="let item of products">
    <app-carousel-builder imgOne={{item.imgOne}} imgDescrOne={{item.imgDescrOne}} imgTwo={{item.imgTwo}} imgDescrTwo={{item.imgDescrTwo}} imgThree={{item.imgThree}} imgDescrThree="" ></app-carousel-builder>
</div>
<app-carousel-builder imgOne="bnr_clean.jpg" imgDescrOne="Clean Ad" imgTwo="bnr_sept_2022_visa2.jpg" imgDescrTwo="Card Ad" imgThree="top100_2019_banner.jpg" imgDescrThree="banner"></app-carousel-builder>
</div>
<app-carousel-builder></app-carousel-builder>
<!-- Bottom Carousel inside of a Card -->
<app-bottom-carousel-card></app-bottom-carousel-card>
<!-- Search Bar -->
<app-search></app-search>
<!-- Bottom of Page Features -->
<app-footer></app-footer>
